import React from "react";



const Create = () =>{


    return (
        <>
        <h1>Create page</h1>
        <form>
            <pre>
                Name of Property   : <input placeholder="Property Name"/><br/>
                Adress of Property : <input placeholder="Property Adress"/><br/>
                Property Rent      : <input placeholder="Property Rent"/><br/>
                Property Details   : <input placeholder="Property Details"></input><br/>

                                     <button type="submit">Create New Data</button>
            </pre>
        </form>
        </>
    )
}


export default Create;
